import React, { Component } from "react";

class Toc extends Component {
  render() {
    const lists = [];
    const data = this.props.contents;
    for (let i = 0; i < data.length; i++) {
      lists.push(
        <li>
          <a href={"/content/" + data[i].id}></a>
        </li>
      );
    }
    return (
      <nav>
        <ul>
          <li>
            <a href="1.html">HTML</a>
          </li>
          <li>
            <a href="2.html">CSS</a>
          </li>
          <li>
            <a href="3.html">JavaScript</a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Toc;
